import React from "react";
import { Container, Text } from "../styledComponents";
import styled from "styled-components";
import { device } from "../../lib/deviceSize";
import hasLogo from "../../public/static/HAS.png";

const ImgWrapper = styled(Container)`
  flex-direction: column;
  /* align-items: center; */
  flex: 0.65;
  padding-top:50px;
  padding-left:60px;
  /* justify-content: center; */
  background-color: ${({ theme }) => theme.btnPrimary};
  min-height: 100%;
  max-height: 100%;
  /* @media ${device.laptopL} {
    flex: 0.65;
  } */
`;
const FormWrapper = styled(Container)`
  flex-direction: row;
  align-items: center;
  flex: 0.35;
  justify-content: center;
  min-height: 100%;
  max-height: 100%;
  /* @media ${device.laptopL} {
  } */
`;

const Login = () => {
  return (
    <Container
      flex={1}
      color="red"
      row
      customStyles={{ minHeight: "100vh", maxHeight: "100vh" }}
    >
      <ImgWrapper>
        <Container flex={false} row center color="red">
          <img
            src={hasLogo}
            style={{ width: "15%", height: "15%", marginRight: "20px" }}
          />
          <Text color="white">House-Assist Space</Text>
        </Container>
      </ImgWrapper>
      <FormWrapper>
        <Text>forms</Text>
      </FormWrapper>
    </Container>
  );
};

export default Login;
